import {deleteProduct} from '../../actions/deleteProduct'

export default function DeleteProd(props){
    
    async function deleteFunc(e){
      e.preventDefault()
      try{
        await deleteProduct(props.id)
      }catch(err){
        console.log(err.message)
      }
    }

    return(
        <div>
          <button onClick={e => deleteFunc(e)}>
            X
          </button>
        </div>
    )
}
